import React, {useState} from 'react';

import './InstagramContainer.css'
import { Image } from "react-bootstrap";

import Header from '../Header/Header.js';
import Chatbox from '../Chatbox/Chatbox.js';
import Toolbar from '../Toolbar/Toolbar.js';

const InstagramContainer = () => {
  const [view, setView] = useState('portrait');

  return(
    <div style={{"width":"600px", "margin": "0 auto", "border":"1px solid gray"}}>
      <Header />
      <Image src="nvidia-communities.jpg" thumbnail />
      <Toolbar />
      <Chatbox view="portrait"/>
    </div>
  );
}

export default InstagramContainer;
